script: |
  super -f tsv -I q730.sql | sort > q730.out

vector: true

inputs:
  - name: q730.sql
    data: |
      SELECT - - col2 AS col2 FROM tab0 WHERE NOT - + ( col1 ) IN ( col1 * - + 99 + + col1, + 70 / 67, col1 * - col2, + - col2 + + col1 - + + col1, - col0, col2 + + + 94, - + 28 );
  - name: tab0

outputs:
  - name: q730.out
    data: |
      10
      47
      99
